import React from 'react';

import './style.scss'

const Header = () => {
	return (
		<div className="header">
			<div className="header-title">
				<h1>Sales statistics</h1>
				<div className="subtitle">Welcome to CRM dashboard</div>
			</div>
			<div className="header-btn">

			</div>
		</div>
	);
};

export default Header;
